  false,\n\t\"url\": null,\n\t\"notes\": \"The Lower Souris Migratory Waterfowl Refuge
  (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
  of the Canadian border in North Dakota. The refuge was established and constructed
  by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
  events taking place on the refuge for November, December and January of 1940 to
  1941. The table of contents includes sections on personnel, general conditions,
  wildlife, refuge maintenance and development, public relations, economic uses of
  the refuge, field investigations and applied research and photographs.\",\n\t\"owner_org\":
